import React from 'react'
import Tiveo from "../../images/tiveo.png";

export const Lobby = () => {
    return (
        <div class="lobby">
            <div>
                <img src={Tiveo} alt="logo" width="400" height="113px" />
                <h2>Encontra la mejor ropa, al mejor precio</h2>
                <button>Comenzar</button>
            </div>

        </div>
    )
}
